import React, { useEffect } from 'react'
import styled from 'styled-components'
import { InnerLayout } from '../../styles/Layouts'
import Chart from '../Charts/Charts'
import { useGlobalContext } from '../../context/globalContext'
import History from '../History/History'
function Dashboard() {
  const{totalExpense,incomes,expenses,totalIncome,getIncomes,getExpenses}= useGlobalContext()

  useEffect(()=>{
    getExpenses()
    getIncomes()

  },[])
  return (
    < DashboardStyled>
    <InnerLayout>
        <h1>All Transaction</h1>
        <div className="stats-con">
            <div className="chart-con">
             <Chart/>
             <div className='amount-con'>
              <div className='income'>
                <h2>Total Income</h2>
                <p>Rs{totalIncome()}</p>
              </div>
              <div className='expense'>
                <h2>Total Expense</h2>
                <p>Rs{totalExpense()}</p>
              </div>

              <div className='balance'>
                <h2>Total Balance</h2>
                <p>Rs{totalIncome()-totalExpense()}</p>
              </div>
             </div>
            </div>
            <div className="history-con">
                <History/>
                <h2 className='salary-title'>Min<span>Salary</span>Max</h2>
                 <div className='salary-item'>
                   <p>
                        <span>Min</span>Rs{Math.min(...incomes.map((income)=>income.amount))}
                    </p>
                    <p>
                        <span>Max</span>Rs{Math.max(...incomes.map((income)=>income.amount))}
                    </p>
                 
                </div>

                <h2 className='salary-title'>Min<span>Expense</span>Max</h2>
                 <div className='salary-item'>
                   <p>
                        <span>Min</span>Rs{Math.min(...expenses.map((expense)=>expense.amount))}
                    </p>
                    <p>
                        <span>Max</span>Rs{Math.max(...expenses.map((expense)=>expense.amount))}
                    </p>

                </div>
            </div>
        </div>


    </InnerLayout>
    </ DashboardStyled>
  )
}

const DashboardStyled = styled.div`
h1{
    color: rgba(34, 34, 96, 1);

}
    h2{
    color:rgba(34, 34, 96, 1);
    }

    .stats-con{
       display: grid;
       grid-template-columns:repeat(5,1fr);
       gap: 2rem;
       .chart-con{
        grid-column: 1/4;
        height: 400px;
        .amount-con{
           display:grid;
           grid-template-columns:repeat(4,1fr);
           margin-top: 2rem;
           .income,.expense{
             grid-column: span 2;

           
           }

           .income,.expense,.balance{
            background: #FCF6F9;
            border: 2px solid #FFFFFF;
            box-shadow: 0px 2px 12px rgba(0, 0, 0, 0.04);
            border-radius: 20px;
            padding: 1rem;

            p{
               

               }

           }
        
        }
        
    }
`;

export default Dashboard;
